- input: "TEXT\x1CC00301929\x1C.TEXT\x1C\x1CF3XA\x1CThis amendment filing reports
    a February 26, 2013 contribution to the Mark Pryor for US Senate campaign.  Due
    to an administrative error, that contribution was not reported on the midyear
    report filed July 31, 2013.     As a sponsoring organization Kelley Drye & Warren,
    LLP has provided free legal and accounting services to KDW PAC as the services
    are solely to help the committee comply with federal campaign finance laws; and,
    because the individuals performing the services are regular employees of the organization
    consistent with Commission regulations at 100.86. The value of those services
    is $2150.\n"
